import React from "react";
import ReactDOM from "react-dom";
import useInput from "./logic";


import  useChuj from "./calc"


function App() {
  const [c1, addC1] = useChuj();
  const [nigger,niggerr]=useInput()
  if(nigger>37500){
    nigger=(nigger * 0.14)
  }
  return (
    <div className="App">
      <h1>Test useState</h1>
      <h2>Example 1</h2>
      <div>
        <div>{c1}</div>
        <button onClick={addC1}>add c1</button>
      </div>

     <div>
      {niggerr}
      <p>{nigger * 0.14}</p>
     </div>
      <hr />
      <div>结论：两次调用 hook 分别产生 2 个不同的对象，互不影响。 </div>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
